import React from "react";

const IngenieriaAmbiental = () => {
  return (
    <div className="container my-5">
      <div className="card shadow-lg">
        <div className="card-body">
          {/* Título principal */}
          <h1 className="text-center text-primary mb-4 fw-bold">INGENIERÍA AMBIENTAL</h1>

          {/* Lista de servicios */}
          <ul className="list-group list-group-flush">
            <li className="list-group-item fw-bold bg-light">Servicios de Ingeniería Ambiental</li>
            <li className="list-group-item">Manifestación de impacto ambiental</li>
            <li className="list-group-item">Informe preventivo</li>
            <li className="list-group-item">Estudios de riesgo</li>
            <li className="list-group-item">Programa de prevención de accidentes</li>
            <li className="list-group-item">Cédula de operación anual</li>
            <li className="list-group-item">Estudios de emisiones a la atmósfera</li>
            <li className="list-group-item">Análisis de aguas residuales</li>
            <li className="list-group-item">CRETI</li>
            <li className="list-group-item">Suelos contaminados</li>
            <li className="list-group-item">Estudios de ambiente laboral</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default IngenieriaAmbiental;
